{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/js7n95/case-study-bellabeat-capstone?scriptVersionId=110437872\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"---\n* title: \"Capstone: Case Study: Bellabeat\"\n* author: \"johnnys7n\"\n* date: \"2022-09-24\"\n* output: html_document: default\n\n---\n# Table of Contents:\n   1. About the Project\n   2. Ask\n   3. Prepare\n   4. Process\n   5. Analyze and Share\n   6. Act\n\n# 1. About the Project\n\n## Details of the Case Study:\n* To-Do: Analyze the usage data to gain insight into how consumers use other smart devices. Focus on finding possible trends to improve marketing strategy. Then create a report of a clear summary of the task, description of all the data sources used, documentation of the data manipulation, analysis, visualizations, and lastly recommendations\n* Company: Bellabeat [link](https://bellabeat.com/)\n* About: Bellabeat is a high-tech company that creates health smart products for women. \n* link: [website](https://bellabeat.com/)\n\n\n## Referenced Data:\n\n* Data Source: FitBit Fitness Tracker Data [link](https://www.kaggle.com/datasets/arashnic/fitbit)\n* Content: Dataset was created by Mobius\n* License: CC0: Public Domain\n* About: Thirty eligible Fitbit users consented to give individual personal health information data on phyiscal activity, sleep, and heart rate.","metadata":{"_uuid":"a25c5a24-d6d4-48bf-85d2-a72f96268916","_cell_guid":"8b7282b7-fed3-44a7-90ae-d84c103200c7","execution":{"iopub.status.busy":"2022-09-24T22:33:42.640855Z","iopu