kage: ‘janitor’\n\n\nThe following objects are masked from ‘package:stats’:\n\n    chisq.test, fisher.test\n\n\n\nAttaching package: ‘lubridate’\n\n\nThe following objects are masked from ‘package:base’:\n\n    date, intersect, setdiff, union\n\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"# 2. Ask\n## Defining Questions to Ask\n1. What are some trends in smart device usage?\n2. How could these trends apply to Bellabeat customers?\n3. How could these trends help influence Bellabeat marketing strategy?\n\n## Additional Questions to Answer\n1. Is the average calories burned correlated with the average steps taken? And their respective Total sums?\n2. Categorize the intensities of the workout and see which one is the most popular in the sample group\n3. Analyze sleep patterns with activity\n4. Use these questions to provide improvements to the Wellness Score of the Bellabeat App\n\n### To answer this question we need to look at:\n1. List of relevant data frames\n2. summary of each one\n3. visualizations to understand trends\n4. statistical tests to provide recommendations to the marketing team of BellaBeat\n\n# 3. Prepare\n\n## Does your data ROCCC?\n1. **R**eliable: The data seems to be reliable as assured by the Fitbit Fitness Tracker acquirer \n2. **O**riginal: The data we can assume is directly from personal health information (identification IDs removed for privacy reasons)\n3. **C**omprehensive: There is a lot of different datasets with a range of variables that can be used for analysis\n4. **C**urrent: The date_time data points were taken at 2016 which is 6 years outdated (year this notebook was created is 2022)\n5. **C**ited: This data is indeed cited \n\n## List of all the Files Provided with the Dataset\nMade into a table for easier viewing","metadata":{"_uuid":"6b2a5dbc-638d-4b52-ae85-f267bf7e2759","_cell_guid":"25c5d287-765e-45da-8750-8471e21f744a","trusted":true}},{"cell_type":"code","source":"#putting all files in the provided folder in