  xlab('Average Total Steps taken') + \n  ylab('Average Calories Burned') +\n  labs(title = \"Correlation between Average steps taken and the average calories burned\", subtitle = paste('Correlation coefficient = ', corr_coeff_1, \",\", \" P-Value = \", corr_pvalue), caption = \"Data Source: Fitbit Fitness Tracker\")\n\ncorr_coeff_2 <- cor(y = df_dA_summary$total_calories, x= df_dA_summary$total_TotalSteps, method = 'spearman')\ncorr_pvalue_1 <- cor.test(y = df_dA_summary$total_calories, x= df_dA_summary$total_TotalSteps, use ='complete.obs', method = 'spearman')$p.value\ndf_dA_summary %>% \n  ggplot(mapping = aes(x = total_TotalSteps, y = total_calories)) +\n  geom_point() +\n  geom_smooth(method = \"lm\") +\n  xlab('Total Steps taken') + \n  ylab('Sum Calories Burned') +\n  labs(title = \"Correlation between Total steps taken and the Total calories burned\", subtitle = paste('Correlation coefficient = ', corr_coeff_2, \",\", \" P-Value = \", corr_pvalue_1), caption = \"Data Source: Fitbit Fitness Tracker\")","metadata":{"_uuid":"a8809b33-da7f-4267-84dc-d45e5ca21d3a","_cell_guid":"73211355-c99e-4087-bd04-83672306dbe4","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-11-08T20:19:05.002717Z","iopub.execute_input":"2022-11-08T20:19:05.007212Z","iopub.status.idle":"2022-11-08T20:19:06.51327Z"},"trusted":true},"execution_count":26,"outputs":[{"name":"stderr","text":"`geom_smooth()` using formula 'y ~ x'\n\n`geom_smooth()` using formula 'y ~ x'\n\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAAPACAIAAAA+Q9WZAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wURRvA8WevJrn0QknoJfSq9F5UkKqCDRBEwZeioiCgWEAROxakKWIFxIqC\nqDRBBUUQQQWkSEd6COnl7vb94+C45JLL5lIOcr/vH364mdmdZ+Z2bmUfdldRVVUAAAAAAAAA\nAAAA+AedrwMAAAAAAAAAAAAAUHpIEAIAAAAAAAAAAAB+hAQhAAAAAAAAAAAA4EdIEAIAAAAA\nAAAAAAB+hAQhAAAAAAAAAAAA4EdIEAIAAAAAAAAAAAB+hAQhAAAAAAAAAAAA4EdIEAIAAAAA\nAAAAAAB+xF8ShKotedmcpwde37pyhehAoyksslyz9jd