ps and total calories burned. This is a good positive test to see the validity of the data. Because we assume that the amount of calories burned should be correlated with the amount taken, we can see that the dataset is reliable. \n\n*For more information on spearman correlation [click on this link](https://statistics.laerd.com/statistical-guides/spearmans-rank-order-correlation-statistical-guide.php)*\n\nNext in our search for trends, we can look at the intensities and perhaps see if there is a specific intensity of workout that might be more preferred on certain days. We will convert the date into weekdays using the **weekdays()** function after converting the \"char\" variable into date variable using the **as.Date()** function.","metadata":{"_uuid":"8b723640-3219-4bd1-ae68-7cb880b904bc","_cell_guid":"87339cb2-f711-4c2e-ab73-c09249e88ea4","trusted":true}},{"cell_type":"code","source":"set_plot_dimensions <- function(width_choice, height_choice) {\noptions(repr.plot.width=width_choice, repr.plot.height=height_choice)\n}\nset_plot_dimensions(20,8)\n\n#cleaning the df_dInt data frame and converting the date into weekdays\ndf_dInt_cleaned <- df_dInt\ndf_dInt_cleaned$ActivityDay <- weekdays(as.Date(df_dInt$ActivityDay, \"%m/%d/%Y\"))\ndf_dInt_cleaned$ActivityDay <- factor(df_dInt_cleaned$ActivityDay, levels = c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\",\"Friday\", \"Saturday\", \"Sunday\"))\n#plotting the activites by minute by weekday\nplot1 <- df_dInt_cleaned %>% \n    group_by(ActivityDay) %>% \n    ggplot(mapping = aes(x = ActivityDay, y = SedentaryMinutes, fill = ActivityDay)) + geom_boxplot() + \n    labs(title = \"Sedentary Minutes throughout the Week\")\nplot2 <- df_dInt_cleaned %>% \n    group_by(ActivityDay) %>%\n    ggplot(mapping = aes(x = ActivityDay, y = LightlyActiveMinutes, fill = ActivityDay)) + geom_boxplot() + \n    labs(title = \"Lightly Active Minutes throughout the Week\")\nplot3 <- df_dInt_cleaned %>% \n    group_by(ActivityDay) %>%\n    ggplot(mapping = aes(x = ActivityDay, y = FairlyActiveMinutes, fill = ActivityDay)) + geom_boxplot() + \n    labs(title = \"Fairly Active Minutes throughout the Week\")\nplot4 <- df_dInt_cleaned %>% \n    group_by(ActivityDay) %>%\n    ggplot(mapping = aes(x = ActivityDay, y = VeryActiveMinutes, fill = ActivityDay)) + geom_boxplot() + \n    labs(title = \"Very Active Minutes throughout the Week\")\n\n#plotting the activites by distance by weekday\nplot5 <- df_dInt_cleaned %>% \n    group_by(ActivityDay) %>% \n    ggplot(mapping = aes(x = ActivityDay, y = SedentaryActiveDistance, fill = ActivityDay)) + geom_boxplot() + \n    labs(title = \"Sedentary Distance throughout the Week\")\nplot6 <- df_dInt_cleaned %>% \n    group_by(ActivityDay) %>%\n    ggplot(mapping = aes(x = ActivityDay, y = LightActiveDistance, fill = ActivityDay)) + geom_boxplot() + \n    labs(title = \"Lightly Active Distance throughout the Week\")\nplot7 <- df_dInt_cleaned %>% \n    group_by(ActivityDay) %>%\n    ggplot(mapping = aes(x = ActivityDay, y = ModeratelyActiveDistance, fill = ActivityDay)) + geom_boxplot() + \n    labs(title = \"Moderately Active Distance throughout the Week\")\nplot8 <- df_dInt_cleaned %>% \n    group_by(ActivityDay) %>%\n    ggplot(mapping = aes(x = ActivityDay, y = VeryActiveDistance, fill = ActivityDay)) + geom_boxplot() + \n    labs(title = \"Very Active Distance throughout the Week\")\n#arrange the plots into a multiplot for easier viewing\nggarrange(plot1, plot2,\n          plot3, plot4,\n         labels = c(\"A\", \"B\", \"C\", \"D\"),\n         ncol = 2,\n          nrow = 2,\n         common.legend = TRUE)\nggpubr::ggarrange(plot5, plot6,\n          plot7, plot8,\n         labels = c(\"A\", \"B\", \"C\", \"D\"),\n         ncol = 2, nrow = 2,\n                 common.legend = TRUE)","metadata":{"_uuid":"05b5764e-1be5-4b2d-b060-feb5d7091804","_cell_guid":"c7284556-d8bf-4137-9c15-d45e96a34041","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iop