MOER\nowAA6+XgNuRRd91PK8cfySwsj0ilWa9HrlbZ2L0y0Mu0miQJIURp/k9lkuQa0NEUz/898Z3L\nN818BVWlfXeAd85vb0Qu2nPbMql49YRnhRDD5re/LSwJIYStvd+c1q7n1o9NSPvjhRYfT/zn\nyJEjL1T8uc5Li3nh858rFho3TQ+/WWbsMT8kL315165dh71xwrTh/Z0eEkKU5pXW8JQAAAAA\nQL1FDwgAgAn/QQgAsGY2y+Nn73p4Zg/fjmPHD27uVLA/NmZnyvXQmQm99HZCCE0DjRDi/aWr\ni1p1HjVsRG/DhL1vDZykmdaxqe7XU9+sXvGFr6d98cXjSzZ8Mn5kROX9ProxYVSnjhuf65Ww\npnu/bgHuzvb5Wb8f3Rv/3S85AY+/vyDQrXy12/Y/osuz299b9UBkP9+2g0cM6tjCNXnP5vW7\nzz44bv1oj1vfHnVs0nHxkDanRz7R2c8lad+W2H3nPTpPWd/PW2N8tbf7+wnz/tH/18e7tvEx\nZv8Wt3qtWmOY899Ai55OAAAAAFA0ekAAACpIAADUd8W5x4UQHgHxZpdeObRhRJ/OBmcHW/sG\nvh16vhqzt9KGJwd2uN9ebXtfu1clScq98PXYR7o0MTg6e/r0GPBY/KmszGML7m+o0zq5Xyoq\nXeijd3AdYNrWWJqz6e0XHwlq7a53Uqu1Lm5ewf83LPrjw8bbErtt/5IkZZ/56l/hIZ56J63O\n1T+g239W7Sip2MDBRtU8fM+5+DeDWzWxt9W4Nm45amr078Vl5Uvz0w7/e3hvbzdnWxt1A0PT\nkPDxn524WmtnEAAAAADuHfSAAADckUqSzLyAFwAAKI1ObeM5KOHXz3rKnQgAAAAAoM7RAwIA\n6hTvIAQAAAAAAAAAAACsCBOEAAAAAAAAAAAAgBWxlTsBAADwtwyOiNB3cpc7CwAAAACAJdAD\nAgDqFO8gBAAAAAAAAAAAAKwIjxgFAAAAAAAAAAAArAgThAAAAAAAAAAAAIAVYYIQAAAAAAAA\nAAAAsCJMEAIAAAAAAAAAAABWhAlCAAAAAAAAAAAAwIowQQgAAAAAAAAAAABYESYIAQAAAAAA\nAAAAACvCBCEAAAAAAAAAAABgRf4f0avjwmcAMMMAAAAASUVORK5CYII="},"metadata":{"image/png":{"width":1200,"height":480}}}]},{"cell_type":"markdown","source":"Strangely enough, it seems like the amount of Calories burned during the day does not affect the sleep patterns, but there does seem to be a significant trend in the amount of calories burned affecting the amount of time spent in bed. The total steps taken seems to also have this inverse relationship with the total time in bed and minutes asleep.\n\nNext, we need to look at averaging per data point (or Id in this case) to make sure multiple Id's are not represented unfairly.\n","metadata":{}},{"cell_type":"code","source":"set_plot_dimensions <- function(width_choice, height_choice) {\noptions(repr.plot.width=width_choice, repr.plot.height=height_choice)\n}\nset_plot_dimensions(20,8)\n\ndc_sleep_summary <- dc_sleep_2 %>% group_by(Id) %>% summarize(mean_cal  = mean(Calories), mean_total_time_in_bed = mean(TotalTimeInBed), mean_total_steps = mean(TotalSteps), mean_total_min_asleep = mean(TotalMinutesAsleep) )\nstr(dc_sleep_summary)\n\n#The p-values of the correlation\ncor_pvalue_1 <- cor.test(y = dc_sleep_summary$mean_cal, x= dc_sleep_summary$mean_total_min_asleep, use ='complete.obs', method = 'spearman')$p.value\ncor_pvalue_2 <- cor.test(y = dc_sleep_summary$mean_cal, x= dc_sleep_summary$mean_total_time_in_bed, use ='complete.obs', method = 'spearman')$p.value\ncor_pvalue_4 <- cor.test(y = dc_sleep_summary$mean_total_steps, x= dc_sleep_summary$mean_total_min_asleep, use ='complete.obs', method = 'spearman')$p.value\ncor_pvalue_3 <- cor.test(y = dc_sleep_summary$mean_total_steps, x= dc_sleep_summary$mean_total_time_in_bed, use ='complete.obs', method = 'spearman')$p.value\n#scatterplots to see trends of calories correlating with totaltimeinbed and totalminautesasleep\nplot_a <- dc_sleep_summary %>% ggplot(mapping = aes(x= mean_cal, y = mean_total_time_in_bed)) + geom_point() + geom_smooth(method ='lm') + labs(title = \"Mean Total Time in Bed vs Mean Calories burned during the day\", subtitle = paste(\"p-value: \", cor_pvalue_2))\nplot_b <- dc_sleep_summary %>% ggplot(mapping = aes(x= mean_cal, y = mean_total_min_asleep)) + geom_point() + geom_smooth(method ='lm') + labs(title = \"Mean Total Minutes Asleep vs Mean Calories burned during the day\", subtitle = paste(\"p-value: \", cor_pvalue_1))\nplot_c <- dc_sleep_summary %>% ggplot(mapping = aes(x= mean_total_steps, y = mean_total_time_in_bed)) + geom_point() + geom_smooth(method ='lm') + labs(title = \"Mean Total Time in Bed vs Mean Total Steps\", subtitle = paste(\"p-value: \", cor_pvalue_3))\nplot_d <- dc_sleep_summary %>% ggplot(mapping = aes(x= mean_total_steps, y = mean_total_min_asleep)) + geom_point() + geom_smooth(method ='lm') + labs(title = \"Mean Total Minutes Asleep vs Mean Total Steps\", subtitle = paste(\"p-value: \", cor_pv