200,"height":480}}}]},{"cell_type":"markdown","source":"*We need to note that some individuals have less data points and therefore less replicates*\nBecause the sample size is too low, the following analysis on the weightlog will not  be included\n\n","metadata":{}},{"cell_type":"markdown","source":"# 6. Act\n\n### So from our analysis we see a lot of different trends that could be interesting. Some of the trends that we found were that \n1. More steps taken meant more Calories burned that day\n2. More calories burned = less time in bed (doesn't affect sleep patterns) and not when averaging per record. \n3. Most people seem to be the most sedentary on Sundays with an increase in very intense workouts on Monday. \n\n## Conclusions, Recommendations, and Next Steps:\nLooking at the data analyzed, we see that there might be a tendency for people to be less active on Sundays then get a surge to workout intensely on Mondays then slowly leveling off the workout throughout the week. Although the sleep patterns seem to be well protected from the amount of calories burned that day, the amount of sleep is very correlated to the amount of time spent in bed. The next thing to look at is the hourly, minutes, and seconds to look at patterns and habits throughout the day to make the smart technology much more customizable and specific to the individual. By using SQL, R Dplyr, or spreadsheets, to separate the Date and Time into separate columns, then analyzing the two columns separately, we can achieve a more sensitive anaylsis. I believe that by looking at how the hourly most steps taken combined with the hourly calories and the heartrate seconds data we will be able to give a much more precise timing of the individuals most active moments throughout the day. If that's the case, by providing customized recommendations and advice to the smart-tech wearer, would be awesome. ","metadata":{}}]}